import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Authentication from './components/Authentication';
import Admin from './components/Admin';
import ForgotPassword from './components/ForgotPassword';
import Dashboard from './components/Dashboard';
import DisposeMenu from './components/DisposeMenu';
import DisposeForm from './components/DisposeForm';
import TrackOrder from './components/TrackOrder';
import Profile from './components/Profile';
import ProtectedRoute from './components/ProtectedRoute';
import EditProfile from './components/EditProfile';
import RewardsPage from './components/RewardsPage';
import AdminDashboard from './components/AdminDashboard';
import MainComponent from './MainComponent';
import ItemForm from './ItemForm';


function App() {
  const [user, setUser] = useState({
    name: 'Manyatha',
    profilePicture: 'https://via.placeholder.com/150'
  });

  const handleLoginSuccess = (userData) => {
    setUser(userData);
  };

  return (
    <div className="bg-gray-900 text-white">
      <Router>
        {/* <HeaderComponent /> */}
        <div className="container">
          <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/user-login" element={<Authentication onLoginSuccess={handleLoginSuccess} />} />
            <Route path="/admin-login" element={<Admin />} />
            <Route path="/edit-profile" element={<EditProfile />} />
            <Route
              path="/rewards-page"
              element={
                <ProtectedRoute user={user}>
                  <RewardsPage />
                </ProtectedRoute>
              }
            />

            <Route path="/customers" element={<Authentication onLoginSuccess={handleLoginSuccess} />} />
            <Route path="/forgot-password" element={<ForgotPassword />} />
            <Route
              path="/dashboard"
              element={
                <ProtectedRoute user={user}>
                  <Dashboard user={user} />
                </ProtectedRoute>
              }
            />
            <Route
              path="/dispose"
              element={
                <ProtectedRoute user={user}>
                  <DisposeMenu />
                </ProtectedRoute>
              }
            />
            <Route
              path="/dispose/:itemType"
              element={
                <ProtectedRoute user={user}>
                  <DisposeForm />
                </ProtectedRoute>
              }
            />
            <Route
              path="/track-order"
              element={
                <ProtectedRoute user={user}>
                  <TrackOrder />
                </ProtectedRoute>
              }
            />
            <Route
              path="/profile"
              element={
                <ProtectedRoute user={user}>
                  <Profile profilePicture={user.profilePicture} name={user.name} />
                </ProtectedRoute>
              }
            />
            <Route
              path="/rewards"
              element={
                <ProtectedRoute user={user}>
                  <div>Rewards Page</div>
                </ProtectedRoute>
              }
            />
            <Route
              path="/customer-support"
              element={
                <ProtectedRoute user={user}>
                  <div>Customer Support Page</div>
                </ProtectedRoute>
              }
            />
            <Route
              path="/about-us"
              element={
                <ProtectedRoute user={user}>
                  <div>About Us/Support Us Page</div>
                </ProtectedRoute>
              }
            />

<Route
  path="/admin-dashboard"
  element={
    <ProtectedRoute user={user} requiredRole="admin">
      <AdminDashboard />
    </ProtectedRoute>
  }
/>

                    <Route path="/" exact component={MainComponent} />
                    <Route path="/add-item/:type" component={ItemForm} />

          </Routes>
        </div>
        {/* <FooterComponent /> */}
      </Router>
    </div>
  );
}

export default App;
